const Media = () => {

	return(
        <div>
		<div className = 'facebook'>
		    <FacebookLoginButton className = 'facebook' onClick={() => alert("Hello")}/>
		   </div>
		    <GoogleLoginButton   className = 'facebook' onClick={() => alert("Hello")}/>

		</div>



		);



}

export default Media;
